import React from "react"

export default function Country(props){
    console.log(props)
    return(
        <div>
            {props.active === "Continent" ? <h1>{props.continent}</h1> : <h1>{props.languages[0].name}</h1>}
            {props.name}
            {props.emoji}
            
        </div>
    )
}
